import React from "react";
import classes from './Item.module.css'
const Items = (props) =>{
   
    return(
        <div>
   <ul>
    {props.onSendData.map((item) =>{
     return <li className={classes.list}>{item.name} -  {item.description} - {item.price}
      <button className={classes.button}>+Add</button>
      </li>
     })}
   </ul>
        </div>
    )

}

export default Items
